import { CanvasIconTypes } from '@workday/design-assets-types';
var icon = {
    name: 'chip',
    type: CanvasIconTypes.System,
    svg: '<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" class="wd-icon-chip wd-icon" focusable="false" role="presentation" viewBox="0 0 24 24"><g class="wd-icon-container"><path d="M6.854.854l16.292 16.293a.5.5 0 0 0 .854-.354V.5a.5.5 0 0 0-.5-.5H7.207a.5.5 0 0 0-.353.854z" class="wd-icon-fill"/></g></svg>',
    filename: 'wd-icon-chip.svg',
    category: 'Core',
    tags: ['planning'],
};
export default icon;
